import React from 'react';
import Carousel from './Carousel';
import Phase1 from '../assets/images/phase1.jpg'

const Dashboard = () => {
  const slides = [
    Phase1
  ];
  
  return (
    <div className='phase1'>
      <Carousel>
          {slides.map((s) => {
            <img src={s}/>
          })}
      </Carousel>
    </div>
  )
}

export default Dashboard
